import React, {Component} from 'react';

import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

class About extends Component {
  constructor(props) {
    super(props);
  }
  render() {
    return(
      <div className="about">
        <Row>
          <Col>
            <p>Image</p>
          </Col>
          <Col>Text about me</Col>
        </Row>
      </div>
    );
  }
}

export default About;
